		["<M+> AutoMarker"] = {
			["outline"] = "OUTLINE",
			["xOffset"] = 0,
			["displayText"] = "",
			["customText"] = "function()\n    if not aura_env.debug then\n        return \"\"\n    end\n    \n    local retstr = \"AutoMarker Debug\\n\"\n    \n    if not UnitIsGroupLeader(\"player\") then\n        return retstr .. \"You are not group leader, nothing will be marked\"\n    end\n    \n    retstr = retstr .. \"You are in zone \" .. aura_env.playerZone .. \"\\n\\n\"\n    \n    retstr = retstr .. \"Target guid: \" .. (UnitGUID(\"target\") or \"empty\") .. \"\\n\\n\"\n    \n    for guid, mark in pairs(aura_env.usedMarkers) do\n        retstr = retstr .. tostring(mark) .. \" - \" .. guid .. \"\\n\"\n    end\n    \n    \n    \n    return retstr\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["customTextUpdate"] = "update",
			["url"] = "https://wago.io/XUmWiyjwj/39",
			["actions"] = {
				["start"] = {
					["custom"] = "\n\n",
					["do_custom"] = false,
				},
				["finish"] = {
				},
				["init"] = {
					["custom"] = "aura_env.debug = false\naura_env.playerZone = \"0\"\naura_env.usedMarkers = {}\naura_env.unmarkedAdds = {}\naura_env.scannedAdds = {}\naura_env.markers = {\n    8, -- Skull\n    1, -- Star\n    3, -- Diamond\n    7, -- Cross\n    2, -- Circle\n    6, -- Square\n    4, -- Triangle\n    5  -- Moon \n}\naura_env.markNames = {\n    [\"Star\"] = 1,\n    [\"Circle\"] = 2,\n    [\"Diamond\"] = 3,\n    [\"Triangle\"] = 4,\n    [\"Moon\"] = 5,\n    [\"Square\"] = 6,\n    [\"Cross\"] = 7,\n    [\"Skull\"] = 8\n}\n\naura_env.Print = function(key, value)\n    if aura_env.debug then\n        if value == nil then\n            print(key)\n        else\n            print(key, value)\n        end\n    end\nend\n\naura_env.RemoveKey = function(t, k)\n    local i = 0\n    local keys, values = {},{}\n    for k,v in pairs(t) do\n        i = i + 1\n        keys[i] = k\n        values[i] = v\n    end\n    \n    while i>0 do\n        if keys[i] == k then\n            table.remove(keys, i)\n            table.remove(values, i)\n            break\n        end\n        i = i - 1\n    end\n    \n    local a = {}\n    for i = 1,#keys do\n        a[keys[i]] = values[i]\n    end\n    \n    return a\nend\n\n-- Simple function that returns the first free (unused) marker\naura_env.GetFirstFreeMarker = function()\n    aura_env.Print(\"=== GetFirstFreeMarker.Start ===\")\n    for _, candidate in ipairs(aura_env.markers) do\n        local valid = true\n        \n        for k, p in pairs(aura_env.usedMarkers) do\n            if candidate == p then\n                valid = false\n                break\n            end\n        end\n        \n        if valid then\n            return candidate\n        end\n    end\n    aura_env.Print(\"=== GetFirstFreeMarker.End ===\")\n    \n    -- No free markers\n    return false\nend\n\naura_env.IsFreeMarker = function(markerIndex)\n    for k, p in pairs(aura_env.usedMarkers) do\n        if markerIndex == p then\n            -- Marker is already in use\n            return false\n        end\n    end\n    \n    -- Marker is not used yet\n    return true\nend\n\n-- Function that marks a given target if it's in the list and a marker is free\naura_env.CheckAndMark = function(target)\n    local uGUID = UnitGUID(target)\n    \n    local unitInCombat = UnitAffectingCombat(target)\n    \n    if not unitInCombat then\n        return\n    end\n    \n    if uGUID then\n        if aura_env.scannedAdds[uGUID] then\n            return\n        end\n        \n        local hasMark = GetRaidTargetIndex(target)\n        local npcId = select(6, strsplit(\"-\", uGUID))\n        \n        aura_env.Print(\"CheckAndMark.HasMark=\", hasMark)\n        -- Another person or addon has marked this target, leave it be\n        if hasMark and not aura_env.usedMarkers[uGUID] then\n            aura_env.Print(\"CheckAndMark.SetUsedMarkWithoutHasMark\")\n            aura_env.usedMarkers[uGUID] = hasMark\n            return\n        end\n        \n        -- Unit has no mark, but his Id persist in used markers. So remove it from used markers.\n        if not hasMark and aura_env.usedMarkers[uGUID] then\n            aura_env.Print(\"CheckAndMark.RemoveUsedMarkWithoutHasMark\")\n            --aura_env.usedMarkers = aura_env.RemoveKey(aura_env.usedMarkers, uGUID)\n        end\n        \n        if not hasMark and npcId then\n            aura_env.Print(\"CheckAndMark.AddGuid=\", uGUID)\n            \n            local bfaNpcEnabled = nil            \n            if aura_env.config[\"BFA\"] and aura_env.config[\"BFA\"][aura_env.playerZone] then\n                bfaNpcEnabled = aura_env.config[\"BFA\"][aura_env.playerZone][npcId .. \"-enabled\"]\n            end\n            \n            local bfaNpcMark = nil\n            if aura_env.config[\"BFA\"] and aura_env.config[\"BFA\"][aura_env.playerZone] then\n                bfaNpcMark = aura_env.config[\"BFA\"][aura_env.playerZone][npcId .. \"-mark\"]\n            end\n            \n            local slNpcEnabled = nil            \n            if aura_env.config[\"SL\"] and aura_env.config[\"SL\"][aura_env.playerZone] then\n                slNpcEnabled = aura_env.config[\"SL\"][aura_env.playerZone][npcId .. \"-enabled\"]\n            end\n            \n            local slNpcMark = nil\n            if aura_env.config[\"SL\"] and aura_env.config[\"SL\"][aura_env.playerZone] then\n                slNpcMark = aura_env.config[\"SL\"][aura_env.playerZone][npcId .. \"-mark\"]\n            end\n            \n            aura_env.Print(\"CheckAndMark.bfaNpcEnabled=\", bfaNpcEnabled)\n            aura_env.Print(\"CheckAndMark.bfaNpcMark=\", bfaNpcMark)\n            aura_env.Print(\"CheckAndMark.slNpcEnabled=\", slNpcEnabled)\n            aura_env.Print(\"CheckAndMark.slNpcMark=\", slNpcMark)\n            \n            if bfaNpcEnabled or slNpcEnabled then\n                local mark = bfaNpcMark or slNpcMark\n                \n                aura_env.Print(\"CheckAndMark.Mark=\", mark)\n                aura_env.Print(\"CheckAndMark.MarkIsFree=\", aura_env.IsFreeMarker(mark))                \n                \n                if aura_env.IsFreeMarker(mark) then\n                    -- Mark is not used for npc\n                    aura_env.Print(\"CheckAndMark.SetMark=\", mark)\n                    SetRaidTarget(target, mark)\n                    aura_env.usedMarkers[uGUID] = mark\n                    aura_env.scannedAdds[uGUID] = true;\n                else\n                    -- Mark is already used for npc with the same Id,\n                    -- so first we have to mark all adds with specific marks and then we should save this npc to list\n                    -- and give him first free mark\n                    aura_env.Print(\"CheckAndMark.MarkIsNotFree\")\n                    aura_env.unmarkedAdds[uGUID] = target\n                end\n            end\n        end\n    end\nend\n\naura_env.MarkOtherUnmarked = function()\n    for k, p in pairs(aura_env.unmarkedAdds) do\n        local mark = aura_env.GetFirstFreeMarker()\n        if mark then\n            SetRaidTarget(p, mark)\n            aura_env.usedMarkers[k] = mark\n            aura_env.scannedAdds[k] = true;\n        end\n    end\n    \n    -- Clear the adds list after marking\n    aura_env.unmarkedAdds = {}\nend\n\n\naura_env.DoMarks = function()\n    aura_env.unmarkedAdds = {}\n    \n    aura_env.CheckAndMark(\"player\")\n    for i = 1,4 do\n        local party = \"party\"..i\n        aura_env.CheckAndMark(party)\n    end\n    for i = 1,40 do\n        \n        local target = \"nameplate\"..i\n        aura_env.CheckAndMark(target)\n    end\n    aura_env.MarkOtherUnmarked()\nend\n\naura_env.ClearData = function()\n    aura_env.scannedAdds = {}\n    aura_env.usedMarkers = {}\n    aura_env.unmarkerkedAdds = {}\nend\n\naura_env.SetPlayerZone = function()\n    local _,_,_,_,_,_,_,zoneId = GetInstanceInfo()\n    aura_env.playerZone = tostring(zoneId)\n    aura_env.Print(\"SetPlayerZone.Zone=\", aura_env.playerZone)\nend",
					["do_custom"] = true,
