						["events"] = "ZONE_CHANGED_NEW_AREA,ZONE_CHANGED,ZONE_CHANGED_INDOORS,PLAYER_REGEN_ENABLED,PLAYER_REGEN_DISABLED, COMBAT_LOG_EVENT_UNFILTERED",
						["custom"] = "function(event, _, subEvent, _, _, _, _, _, destGUID, ...)\n    if event == \"PLAYER_REGEN_ENABLED\" or event == \"PLAYER_REGEN_DISABLED\" then\n        aura_env.ClearData()\n    end\n    \n    if event == \"ZONE_CHANGED_NEW_AREA\" or \"ZONE_CHANGED\" or \"ZONE_CHANGED_INDOORS\" then\n        aura_env.SetPlayerZone()\n    end\n    \n    if subEvent == \"UNIT_DIED\" then\n        aura_env.usedMarkers = aura_env.RemoveKey(aura_env.usedMarkers, destGUID)\n        aura_env.scannedAdds = aura_env.RemoveKey(aura_env.scannedAdds, destGUID)\n    end\n    \n    return true\nend",
