						["custom"] = "function()\n    -- Don't scan too often\n    local timeNow = GetTime()\n    \n    if timeNow - (aura_env.lastScan or 0) < 0.2 then\n        return true\n    end\n    \n    -- Don't mark if not leader. We really shouldn't even load the WA, but there's no leader condition.    \n    if not UnitIsGroupLeader(\"player\") then\n        return true\n    end\n    \n    -- In a zone where nothing should be marked\n    if not aura_env.playerZone or (not aura_env.config[\"BFA\"][aura_env.playerZone] and not aura_env.config[\"SL\"][aura_env.playerZone]) then\n        return true\n    end\n    \n    aura_env.lastScan = timeNow\n    \n    aura_env.DoMarks()\n    \n    return true\nend",
