						["event"] = "Combat Log",
						["custom"] = "function(event, ...)\n    local arg1, arg2 = ...\n    local currentXP = UnitXP(\"player\")\n    local maxXP = UnitXPMax(\"player\")\n    local currentTime = time()\n    local WAS = aura_env.GetSavedVars()\n    \n    --print(event, arg1, arg2)\n    \n    if \"PLAYER_ENTERING_WORLD\" == event then\n        if arg1 then\n            WAS.session.gainedXP = 0\n            WAS.session.lastXP = currentXP\n            WAS.session.maxXP = maxXP\n            WAS.session.startTime = currentTime\n            WAS.session.realTotalTime = 0\n            WAS.session.realLevelTime = 0\n            WAS.session.lastTimePlayedRequest = 0\n        end\n        \n        if aura_env.config[\"leveltime-text\"] and WAS.session.lastTimePlayedRequest <= 0 then\n            RequestTimePlayed()\n        end\n    elseif \"PLAYER_LEVEL_UP\" == event then\n        aura_env.level = arg1 or aura_env.level\n        aura_env.isPlayerMaxLevel = aura_env.level >= GetMaxLevelForPlayerExpansion()\n        \n        WAS.session.realLevelTime = 0\n        WAS.session.maxXP = maxXP\n        \n        WAS.session.lastTimePlayedRequest = currentTime\n        \n    elseif \"UPDATE_EXPANSION_LEVEL\" == event then\n        aura_env.isPlayerMaxLevel = aura_env.level >= GetMaxLevelForPlayerExpansion()\n        \n    elseif \"QUEST_LOG_UPDATE\" == event then --\"QUEST\" == event:sub(0,5) then\n        aura_env.UpdateQuestXP()\n        \n    elseif \"TIME_PLAYED_MSG\" == event and arg2 then\n        WAS.session.realTotalTime = arg1\n        WAS.session.realLevelTime = arg2\n        \n        WAS.session.lastTimePlayedRequest = currentTime\n        \n    elseif \"PLAYER_XP_UPDATE\" == event then\n        local gainedXP = currentXP - WAS.session.lastXP\n        \n        if gainedXP < 0 then\n            gainedXP = WAS.session.maxXP - WAS.session.lastXP + currentXP\n        end\n        \n        WAS.session.gainedXP = WAS.session.gainedXP + gainedXP\n        WAS.session.lastXP = currentXP\n        WAS.session.maxXP = maxXP\n        \n        aura_env.lastUpdate = 0\n        \n    elseif \"OPTIONS\" == event then\n        if aura_env.config[\"leveltime-text\"] and WAS.session.lastTimePlayedRequest <= 0 then\n            if not aura_env.tickerRTP then\n                aura_env.tickerRTP = C_Timer.NewTicker(0.25, aura_env.RequestTimePlayed)\n            end\n        elseif aura_env.tickerRTP then\n            aura_env.tickerRTP:Cancel()\n            aura_env.tickerRTP = nil\n        end\n    end\n    \n    return true\nend",
