					["do_custom"] = true,
				},
				["init"] = {
					["custom"] = "-- lint\nlocal _G = _G\nlocal GetInventoryItemDurability = _G.GetInventoryItemDurability\nlocal GameTooltip = _G.GameTooltip\nlocal CreateFrame = _G.CreateFrame\nlocal UIParent = _G.UIParent\nlocal InCombatLockdown = _G.InCombatLockdown\nlocal GetInventoryItemLink = _G.GetInventoryItemLink\nlocal GameTooltip_SetDefaultAnchor = _G.GameTooltip_SetDefaultAnchor or GameTooltip:SetAnchorType('ANCHOR_CURSOR')\n\n-- vars\nlocal aura_env = aura_env -- luacheck: ignore\nlocal WeakAuras = WeakAuras -- luacheck: ignore\n\naura_env.Durability = 0\n\naura_env.OnShow = function(self)\n    if (not self.Frame) then\n        self.Frame = CreateFrame('Button', nil, UIParent, 'SecureActionButtonTemplate')\n        self.Frame:SetAttribute('type', 'macro')\n        self.Frame:SetAttribute('macrotext', '/script ToggleCharacter(\"PaperDollFrame\")')\n        self.Frame:SetFrameStrata('BACKGROUND')\n        self.Frame:SetScript('OnEnter', function() WeakAuras.ScanEvents('DURABILITY_MOUSEOVER', true) end)\n        self.Frame:SetScript('OnLeave', function() WeakAuras.ScanEvents('DURABILITY_MOUSEOVER', false) end)\n    end\n    self.Frame:SetAllPoints(WeakAuras.regions[self.id].region)\nend\n\naura_env.OnHide = function(self)\n    if (self.Frame) then\n        self.Frame:Hide()\n        self.Frame:SetParent(nil)\n        self.Frame:UnregisterAllEvents()\n        if (not InCombatLockdown()) then self.Frame:ClearAllPoints() end\n    end\n    self.Frame = nil\nend\n\n-- event\naura_env.DURABILITY_MOUSEOVER = function(mouseover)\n    if (not GameTooltip:IsForbidden()) then\n        if (mouseover) then\n            GameTooltip:SetOwner(UIParent)\n            GameTooltip_SetDefaultAnchor(GameTooltip, UIParent)\n            GameTooltip:SetText('Durability')\n            for i = 1, 18 do\n                local cur, max = GetInventoryItemDurability(i)\n                if (cur and max) then\n                    GameTooltip:AddDoubleLine(GetInventoryItemLink('player', i), math.floor(100 / max * cur).. '%', nil, nil, nil, 1, 1, 1)\n                    --GameTooltip:AddTexture(GetInventoryItemTexture('player', i))\n                end\n            end\n            GameTooltip:Show()\n        else GameTooltip:Hide() end\n    end\nend\n\naura_env.UPDATE_INVENTORY_DURABILITY = function()\n    aura_env.Durability = 100\n    for i = 1, 18 do local cur, max = GetInventoryItemDurability(i)\n        if cur and max then\n            cur = math.floor(100 / max * cur)\n            if (cur < aura_env.Durability) then aura_env.Durability = cur end\n        end\n    end\nend\n\naura_env.PLAYER_DEAD = aura_env.UPDATE_INVENTORY_DURABILITY\naura_env.PLAYER_ENTERING_WORLD = aura_env.UPDATE_INVENTORY_DURABILITY",
					["do_custom"] = true,
				},
